A real treat for anyone who loves listening to the tinkling 
of the jazz piano, with classics from Count Basie, Thelonious Monk, 
Oscar Peterson, Abdullah Ibrahim, Stan Tracey and Jacques Loussier 
to Duke Ellington, Return to Forever and Herbie Hancock. The 
performances are culled from cult classic programmes such as 
Jazz 625, Show of the Week, Late Night Line Up, Love You Madly, 
Birdland, The Late Show and Later... with Jools Holland, and date 
from 1964 to 2009.Be it bebop, swing or contemporary, Jazz Piano Gold 
is a must for all jazz piano fans.

